import { useNavigate } from "react-router-dom";
import { FormEvent } from "react";
import {
  Form,
  Title,
  InputWrapper,
  Input,
  FindWapper,
} from "../login/LoginForm.styled";

interface LoginFormData {
  username: string;
  password: string;
}

const Login = () => {
  const navigate = useNavigate();

  const handleSubmit = (e: FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    // 로그인 로직 구현
  };

  const goToSignup = () => {
    const handleconfirm = confirm("회원가입 페이지로 이동하시겠습니까?");
    if (handleconfirm) {
      navigate("/signup");
    }
  };

  return (
    <Form>
      <Title>MOVING 로그인</Title>
      <InputWrapper>
        <Input type="text" placeholder="아이디" />
        <Input type="password" placeholder="비밀번호" />
      </InputWrapper>
      <Input type="submit" className="submitBtn" />
      <FindWapper>
        <div className="findauth">
          <div onClick={() => alert("서비스 준비중 입니다.")}>아이디 찾기</div>
          <div onClick={() => alert("서비스 준비중 입니다.")}>
            비밀번호 찾기
          </div>
        </div>
        <div className="goToSignup">
          <div>아직 회원이 아니신가요?</div>
          <div onClick={goToSignup}>회원가입</div>
        </div>
      </FindWapper>
    </Form>
  );
};

export default Login;
